        "project_description": "<p><br></p><p><b>General </b></p><p><b><br></b></p><p>En WAVE nos esforzamos por generar oportunidades de desarrollo, a través de la gestión y amplificación de diferentes programas. En la actualidad lideramos varios proyectos sociales y uno de ellos se llama “BILT” que tiene como objetivo la reconstrucción de 4 viviendas de la comunidad de Juchitán, Oaxaca considerando su contexto local y las necesidades de las familias que perdieron su vivienda tras el sismo del 19 de septiembre de 2018. Mediante esta iniciativa buscamos recaudar los recursos necesarios para desarrollar el proyecto y de esta forma brindar a las familias afectadas una nueva oportunidad para tener su casa propia y una vivienda digna, que preserve los valores fundamentales de la familia istmeña y que respete la arquitectura tradicional de la región. Para lograr éste reto necesitamos fondear el desarrollo de las viviendas para que se puedan construir de manera simultánea, y lograr nuestra meta: 4 hogares reconstruidos en un término de 6 meses.</p><p><br></p><p><b> ESQUEMA PROYECTO</b><b><br></b></p><p><b><br></b></p><p> Se construirán 4 viviendas de interés social, diseñadas bajo un enfoque que resalta la arquitectura del lugar y respecta tipología de las casas de Juchitán.</p><p><br></p><p><b>Características de las viviendas </b></p><p><b><br></b></p><p>Las viviendas cuentan con espacios amplios de acuerdo a lo requerido por las familias istmeñas por ahora: corredor, hamaca, hamaquero, sala-comedor, baño por fuera con acceso al corredor y al patio. Está construida por materiales tradicionales a los que está acostumbrada la familias istmeñas como la piedra (blocks, cemento), ladrillos, arcilla, pisos de ladrillo y reforzados con acero (varilla, alambrón, alambre recocido) para resistir los fuertes sismos a los que son expuestas las miles de familias que viven en el territorio del Istmo de Tehuantepec. Cada hogar contará con Nuestras viviendas cuentan con espacios amplios de acuerdo a lo requerido por las familias istmeñas por ahora: corredor, hamaca, hamaquero, sala-comedor, baño por fuera con acceso al corredor y al patio. El diseño de los hogares es único y está proyectado por un equipo interdisciplinario ingenieros y arquitectos de la región del Istmo de Tehuantepec con estudios en México y el extranjero, así como la participación de diversas especialistas, Universidades Públicas y Privadas y organizaciones de la sociedad civil.</p>",
